import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import DualPane from "../utlilty/DualPane";
import InfoCard from "../utlilty/InfoCard";
import trek_lake from "../images/Hobbies/Trek_Lake.jpg";
import trek_finish from "../images/Hobbies/Trek_Finish.jpg";

const useStyles = makeStyles(theme => ({
    videos: {
        justifyContent: 'space-evenly'
    },
    grid_text: {
        padding: 20
    }
}));

export default function Trekking() {
    const classes = useStyles();
    return (
        <div>
            <div>
                <Grid container justify="space-evenly">
                    <Grid item xs={5}>
                        <img src={props.src1}
                        />
                    </Grid>
                    <Grid item xs={5}>
                        <Iframe src={props.src2}
                                id="frame2"
                                display="initial"
                                height="300px"
                                allowFullScreen
                        />
                    </Grid>
                </Grid>

                <Divider className={classes.divider} variant="middle"/>
            </div>

            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={6}>
                    <InfoCard>
                        <ul>
                            <li> Started learning at age of 13.</li>
                            <li> Trained in <i>Classical Music</i> for 6 years in Chennai.
                                Completed <b>5</b> grades under the <i>Trinity College, London</i>.
                            </li>
                            <li> Today, I have expanded my interest to popular movie themes, <i>jazz</i>,
                                and <i>rock</i> music.
                            </li>
                        </ul>
                    </InfoCard>
                </Grid>
                <Grid item xs={6}>
                    <InfoCard anec>
                        I was once recorded playing the piano at the campus dorms for a film student's project!
                        I've met people with interesting backgrounds and experience in the campus piano room.
                        <br/><br/> My favourite pieces to play include:
                        <ul>
                            <li><i> La La Land: Epilogue</i></li>
                            <li><i> Firth of Fifth (Genesis)</i></li>
                        </ul>
                    </InfoCard>
                </Grid>
            </Grid>
        </div>
    );
}
